import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    marginTop: 70,
    flexDirection: 'row',
    justifyContent: 'center'
  },
  cateWrapper: {
    flexDirection: 'column',
    alignItems: 'center',
    paddingHorizontal: 20
  },
  cateImage: {
    height: 50, 
    width: 50,
    resizeMode: 'contain'
  },
  cateText: {
    fontWeight: 'bold'
  }
});

export default styles;
